import React, {Component} from 'react';
import './App.css';
import {About, Header, Contact, Portfolio, Footer} from 'components'
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
/* class App extends React.Component {
    render() {
        return ( <div>
            <Header/>
            <div id = "About">
            <About/>
            <div>
            </div> <div>
            <Contact/>
            </div> <div>
            <Portfolio/>
            </div> 
            </div> 
            <Footer/>
            </div>
        );
    }
} */
function App() 
{
    return (
      <div className="App">
        <Router>
          <Header/>
          <Switch>
            <Route path="/" exact component={() => <About/>} />
            <Route path="/contact" exact component={() => <Contact/>} />
            <Route path="/portfolio" exact component={() => <Portfolio/>} />
          </Switch>
          <Footer />
        </Router>
      </div>
    );
  }

export default App;
